const Navbar = (props) => {
    return (
        <nav className="App-navbar">
            <div className="App-navbar-container">
                <a className="App-logo"><i class="fab fa-sith"></i>UniteTheWorld</a>
                <div className="App-navbar-toggle">
                    <span className="App-navbar-bar"></span>
                    <span className="App-navbar-bar"></span>
                    <span className="App-navbar-bar"></span>
                </div>
                <ul className="App-navbar-menu">
                    <li className="App-navbar-item">
                        <a className="App-navbar-link">About</a>
                    </li>
                    <li className="App-navbar-item">
                        <a className="App-navbar-link">Donate</a>
                    </li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
